import '../styles/navbar.css'

const  Navbar= () => {
    return ( 
        <div className="navbar">
            <div className="logo">
                <img height={50} width={80} src="https://secure-media.hotstar.com/web-assets/prod/images/Disney+Hotstar.jpg" alt="" />
            </div>
            <div className="nav_links">
                <ul>
                    <li><a href="">Home</a></li>
                    <li><a href="">Favourites</a></li>
                    <li><a href="">Add to Favourites</a></li>
                    <li><a href="">Logout</a></li>
                </ul>
            </div>
        </div>
     );
}
 
export default Navbar;
